            },
            {
              "type": "string",
              "format": "uri",
              "description": "Property. Identifier format of any NGSI entity"
            }
          ],
          "description": "Relationship. Model:'https://schema.org/URL'. Unique identifier of the Compartment the Pen is located in."
        },
