          "type": "string",
          "format": "date-time",
          "description": "Property. Model:'https://schema.org/DateTime'. Date and time at which the measurements in the item were taken. Units:'Seconds'"
        },
        "luminosity": {
          "type": "number",
          "minimum": 0,
