                    ],
                    "description": "Property. NGSI type. It has to be EquivalentBranch"
                },
                "negativeR12": {
                    "description": "Property. Model:'https://schema.org/Number'. Negative sequence series resistance from terminal sequence  1 to terminal sequence 2. Used for short circuit data exchange according to IEC 60909 EquivalentBranch is a result of network reduction prior to the data exchange Default: 0.0",
                    "type": "number"
                },
                "negativeR21": {
                    "description": "Property. Model:'https://schema.org/Number'. Negative sequence series resistance from terminal sequence 2 to terminal sequence 1. Used for short circuit data exchange according to IEC 60909 EquivalentBranch is a result of network reduction prior to the data exchange Default: 0.0",
                    "type": "number"
                },
                "negativeX12": {
                    "description": "Property. Model:'https://schema.org/Number'. Negative sequence series reactance from terminal sequence  1 to terminal sequence 2. Used for short circuit data exchange according to IEC 60909 Usage : EquivalentBranch is a result of network reduction prior to the data exchange Default: 0.0",
                    "type": "number"
                },
                "negativeX21": {
                    "description": "Property. Model:'https://schema.org/Number'. Negative sequence series reactance from terminal sequence 2 to terminal sequence 1. Used for short circuit data exchange according to IEC 60909. Usage: EquivalentBranch is a result of network reduction prior to the data exchange Default: 0.0",
                    "type": "number"
                },
                "positiveR12": {
                    "description": "Property. Model:'https://schema.org/Number'. Positive sequence series resistance from terminal sequence  1 to terminal sequence 2 . Used for short circuit data exchange according to IEC 60909.  EquivalentBranch is a result of network reduction prior to the data exchange. Default: 0.0",
                    "type": "number"
                },
                "positiveR21": {
                    "description": "Property. Model:'https://schema.org/Number'. Positive sequence series resistance from terminal sequence 2 to terminal sequence 1. Used for short circuit data exchange according to IEC 60909 EquivalentBranch is a result of network reduction prior to the data exchange Default: 0.0",
                    "type": "number"
                },
