                    "description": "Property. Model:'https://schema.org/Number'. Positive sequence series reactance from terminal sequence  1 to terminal sequence 2. Used for short circuit data exchange according to IEC 60909 Usage : EquivalentBranch is a result of network reduction prior to the data exchange Default: 0.0",
                    "type": "number"
                },
                "positiveX21": {
                    "description": "Property. Model:'https://schema.org/Number'. Positive sequence series reactance from terminal sequence 2 to terminal sequence 1. Used for short circuit data exchange according to IEC 60909 Usage : EquivalentBranch is a result of network reduction prior to the data exchange Default: 0.0",
                    "type": "number"
                },
                "r": {
                    "description": "Property. Model:'https://schema.org/Number'. Positive sequence series resistance of the reduced branch. Default: 0.0",
                    "type": "number"
                },
                "r21": {
                    "description": "Property. Model:'https://schema.org/Number'. Resistance from terminal sequence 2 to terminal sequence 1 .Used for steady state power flow. This attribute is optional and represent unbalanced network such as off-nominal phase shifter. If only EquivalentBranch.r is given, then EquivalentBranch.r21 is assumed equal to EquivalentBranch.r. Usage rule : EquivalentBranch is a result of network reduction prior to the data exchange. Default: 0.0",
                    "type": "number"
                },
