    "$schemaVersion": "0.0.1",
    "modelTags": "",
    "$id": "https://smart-data-models.github.io/dataModels.CIMEnergyClasses/GovSteamFV4/schema.json",
    "title": " Smart Data Models - GovSteamFV4",
    "description": "Adapted from CIM data models. Detailed electro-hydraulic governor for steam unit.",
    "type": "object",
    "allOf": [
        {
            "$ref": "https://smart-data-models.github.io/data-models/common-schema.json#/definitions/GSMA-Commons"
        },
        {
            "$ref": "https://smart-data-models.github.io/data-models/common-schema.json#/definitions/Location-Commons"
        },
        {
            "properties": {
                "type": {
                    "type": "string",
                    "enum": [
                        "GovSteamFV4"
                    ],
                    "description": "Property. NGSI type. It has to be GovSteamFV4"
                },
                "cpsmn": {
                    "description": "Property. Model:'https://schema.org/Number'. Minimum value of pressure regulator output (Cpsmn).  Typical Value = -1. Default: 0.0",
                    "type": "number"
                },
                "cpsmx": {
                    "description": "Property. Model:'https://schema.org/Number'. Maximum value of pressure regulator output (Cpsmx).  Typical Value = 1. Default: 0.0",
                    "type": "number"
                },
                "crmn": {
                    "description": "Property. Model:'https://schema.org/Number'. Minimum value of regulator set-point (Crmn).  Typical Value = 0. Default: 0.0",
                    "type": "number"
                },
                "crmx": {
                    "description": "Property. Model:'https://schema.org/Number'. Maximum value of regulator set-point (Crmx).  Typical Value = 1.2. Default: 0.0",
                    "type": "number"
                },
                "kdc": {
                    "description": "Property. Model:'https://schema.org/Number'. Derivative gain of pressure regulator (Kdc).  Typical Value = 1. Default: 0.0",
                    "type": "number"
                },
                "kf1": {
                    "description": "Property. Model:'https://schema.org/Number'. Frequency bias (reciprocal of droop) (Kf1).  Typical Value = 20. Default: 0.0",
                    "type": "number"
                },
                "kf3": {
                    "description": "Property. Model:'https://schema.org/Number'. Frequency control (reciprocal of droop) (Kf3).  Typical Value = 20. Default: 0.0",
                    "type": "number"
                },
                "khp": {
                    "description": "Property. Model:'https://schema.org/Number'. Fraction  of total turbine output generated by HP part (Khp).  Typical Value = 0.35. Default: 0.0",
                    "type": "number"
                },
                "kic": {
                    "description": "Property. Model:'https://schema.org/Number'. Integral gain of pressure regulator (Kic).  Typical Value = 0.0033. Default: 0.0",
                    "type": "number"
                },
                "kip": {
                    "description": "Property. Model:'https://schema.org/Number'. Integral gain of pressure feedback regulator (Kip).  Typical Value = 0.5. Default: 0.0",
                    "type": "number"
                },
                "kit": {
                    "description": "Property. Model:'https://schema.org/Number'. Integral gain of electro-hydraulic regulator (Kit).  Typical Value = 0.04. Default: 0.0",
                    "type": "number"
                },
                "kmp1": {
                    "description": "Property. Model:'https://schema.org/Number'. First gain coefficient of  intercept valves characteristic (Kmp1).  Typical Value = 0.5. Default: 0.0",
                    "type": "number"
                },
                "kmp2": {
                    "description": "Property. Model:'https://schema.org/Number'. Second gain coefficient of intercept valves characteristic (Kmp2).  Typical Value = 3.5. Default: 0.0",
                    "type": "number"
                },
                "kpc": {
                    "description": "Property. Model:'https://schema.org/Number'. Proportional gain of pressure regulator (Kpc).  Typical Value = 0.5. Default: 0.0",
                    "type": "number"
                },
                "kpp": {
                    "description": "Property. Model:'https://schema.org/Number'. Proportional gain of pressure feedback regulator (Kpp).  Typical Value = 1. Default: 0.0",
                    "type": "number"
                },
                "kpt": {
                    "description": "Property. Model:'https://schema.org/Number'. Proportional gain of electro-hydraulic regulator (Kpt).  Typical Value = 0.3. Default: 0.0",
                    "type": "number"
                },
                "krc": {
                    "description": "Property. Model:'https://schema.org/Number'. Maximum variation of fuel flow (Krc).  Typical Value = 0.05. Default: 0.0",
                    "type": "number"
                },
                "ksh": {
                    "description": "Property. Model:'https://schema.org/Number'. Pressure loss due to flow friction in the boiler tubes (Ksh).  Typical Value = 0.08. Default: 0.0",
                    "type": "number"
                },
                "lpi": {
                    "description": "Property. Model:'https://schema.org/Number'. Maximum negative power error (Lpi).  Typical Value = -0.15. Default: 0.0",
                    "type": "number"
                },
                "lps": {
                    "description": "Property. Model:'https://schema.org/Number'. Maximum positive power error (Lps).  Typical Value = 0.03. Default: 0.0",
                    "type": "number"
                },
                "mnef": {
                    "description": "Property. Model:'https://schema.org/Number'. Lower limit for frequency correction (MN).  Typical Value = -0.05. Default: 0.0",
                    "type": "number"
                },
                "mxef": {
                    "description": "Property. Model:'https://schema.org/Number'. Upper limit for frequency correction (MX).  Typical Value = 0.05. Default: 0.0",
                    "type": "number"
                },
                "pr1": {
                    "description": "Property. Model:'https://schema.org/Number'. First value of pressure set point static characteristic (Pr1).  Typical Value = 0.2. Default: 0.0",
                    "type": "number"
                },
                "pr2": {
                    "description": "Property. Model:'https://schema.org/Number'. Second value of pressure set point static characteristic, corresponding to Ps0 = 1.0 PU (Pr2).  Typical Value = 0.75. Default: 0.0",
                    "type": "number"
                },
                "psmn": {
                    "description": "Property. Model:'https://schema.org/Number'. Minimum value of pressure set point static characteristic (Psmn).  Typical Value = 1. Default: 0.0",
                    "type": "number"
                },
                "rsmimn": {
                    "description": "Property. Model:'https://schema.org/Number'. Minimum value of integral regulator (Rsmimn).  Typical Value = 0. Default: 0.0",
                    "type": "number"
                },
                "rsmimx": {
                    "description": "Property. Model:'https://schema.org/Number'. Maximum value of integral regulator (Rsmimx).  Typical Value = 1.1. Default: 0.0",
                    "type": "number"
                },
                "rvgmn": {
                    "description": "Property. Model:'https://schema.org/Number'. Minimum value of integral regulator (Rvgmn).  Typical Value = 0. Default: 0.0",
                    "type": "number"
                },
                "rvgmx": {
                    "description": "Property. Model:'https://schema.org/Number'. Maximum value of integral regulator (Rvgmx).  Typical Value = 1.2. Default: 0.0",
                    "type": "number"
                },
                "srmn": {
                    "description": "Property. Model:'https://schema.org/Number'. Minimum valve opening (Srmn).  Typical Value = 0. Default: 0.0",
                    "type": "number"
                },
                "srmx": {
                    "description": "Property. Model:'https://schema.org/Number'. Maximum valve opening (Srmx).  Typical Value = 1.1. Default: 0.0",
                    "type": "number"
                },
                "srsmp": {
                    "description": "Property. Model:'https://schema.org/Number'. Intercept valves characteristic discontinuity point (Srsmp).  Typical Value = 0.43. Default: 0.0",
                    "type": "number"
                },
                "svmn": {
                    "description": "Property. Model:'https://schema.org/Number'. Maximum regulator gate closing velocity (Svmn).  Typical Value = -0.0333. Default: 0.0",
                    "type": "number"
                },
                "svmx": {
                    "description": "Property. Model:'https://schema.org/Number'. Maximum regulator gate opening velocity (Svmx).  Typical Value = 0.0333. Default: 0.0",
                    "type": "number"
                },
                "ta": {
                    "description": "Property. Model:'https://schema.org/Number'. Control valves rate opening time (Ta).  Typical Value = 0.8. Default: 0",
                    "type": "number"
                },
                "tam": {
                    "description": "Property. Model:'https://schema.org/Number'. Intercept valves rate opening time (Tam).  Typical Value = 0.8. Default: 0",
                    "type": "number"
                },
                "tc": {
                    "description": "Property. Model:'https://schema.org/Number'. Control valves rate closing time (Tc).  Typical Value = 0.5. Default: 0",
                    "type": "number"
                },
                "tcm": {
                    "description": "Property. Model:'https://schema.org/Number'. Intercept valves rate closing time (Tcm).  Typical Value = 0.5. Default: 0",
                    "type": "number"
                },
                "tdc": {
                    "description": "Property. Model:'https://schema.org/Number'. Derivative time constant of pressure regulator (Tdc).  Typical Value = 90. Default: 0",
                    "type": "number"
                },
                "tf1": {
                    "description": "Property. Model:'https://schema.org/Number'. Time constant of fuel regulation (Tf1).  Typical Value = 10. Default: 0",
                    "type": "number"
                },
                "tf2": {
                    "description": "Property. Model:'https://schema.org/Number'. Time constant of steam chest (Tf2).  Typical Value = 10. Default: 0",
                    "type": "number"
                },
                "thp": {
                    "description": "Property. Model:'https://schema.org/Number'. High pressure (HP) time constant of the turbine (Thp).  Typical Value = 0.15. Default: 0",
                    "type": "number"
                },
                "tmp": {
                    "description": "Property. Model:'https://schema.org/Number'. Low pressure (LP) time constant of the turbine (Tmp).  Typical Value = 0.4. Default: 0",
                    "type": "number"
                },
                "trh": {
                    "description": "Property. Model:'https://schema.org/Number'. Reheater  time constant of the turbine (Trh).  Typical Value = 10. Default: 0",
                    "type": "number"
                },
                "tv": {
                    "description": "Property. Model:'https://schema.org/Number'. Boiler time constant (Tv).  Typical Value = 60. Default: 0",
                    "type": "number"
                },
                "ty": {
                    "description": "Property. Model:'https://schema.org/Number'. Control valves servo time constant (Ty).  Typical Value = 0.1. Default: 0",
                    "type": "number"
                },
                "y": {
                    "description": "Property. Model:'https://schema.org/Number'. Coefficient of linearized equations of turbine (Stodola formulation) (Y).  Typical Value = 0.13. Default: 0.0",
                    "type": "number"
                },
                "yhpmn": {
                    "description": "Property. Model:'https://schema.org/Number'. Minimum control valve position (Yhpmn).  Typical Value = 0. Default: 0.0",
                    "type": "number"
                },
                "yhpmx": {
                    "description": "Property. Model:'https://schema.org/Number'. Maximum control valve position (Yhpmx).  Typical Value = 1.1. Default: 0.0",
                    "type": "number"
                },
                "ympmn": {
                    "description": "Property. Model:'https://schema.org/Number'. Minimum intercept valve position (Ympmn).  Typical Value = 0. Default: 0.0",
                    "type": "number"
                },
                "ympmx": {
                    "description": "Property. Model:'https://schema.org/Number'. Maximum intercept valve position (Ympmx).  Typical Value = 1.1. Default: 0.0",
                    "type": "number"
                }
            }
        }
    ]
}

