        {
            "$ref": "https://smart-data-models.github.io/data-models/common-schema.json#/definitions/Location-Commons"
        },
        {
            "properties": {
                "type": {
                    "type": "string",
                    "description": "Property. NGSI Entity type. It has to be Measurement",
                    "enum": [
                        "DeviceMeasurement"
