                    "description": "Property. Model:'https://schema.org/Number'. Units:'Meters'. Height of the waves."
                },
                "wavePeriod": {
                    "type": "number",
                    "description": "Property. Model:'https://schema.org/Number'. Units:'Seconds'. Indicates the time between the crests of a wave."
                },
